window.bookSummaryJSON = "<p><b>Follow the career of a young officer in the 22nd Century genetically engineered space navy. </b></p> <p>In an era of genetic engineering, Lieutenant Henry Gallant is the only Natural (non-genetically enhanced) officer left in the fleet. In spite of his superiors' concerns that he is not up to the challenge, his unique mental abilities have proven essential to the defense of the United Planets in its fight against the Titan invaders.&nbsp;</p> <p>Gallant allies himself with Alaina Hepburn, the leader of the democratic opposition. With Alaina's help, he discovers that the ancient AI has a sinister ulterior motive and he must match his exceptional mind against the complexity of machine intelligence to escape the ultimate trap and prevent the extermination of humanity.&nbsp;</p> <p>In Lieutenant Henry Gallant, one man pits the naked human mind against the perspicacity of machine intelligence.</p>"; 
